import React, { useRef } from "react"
import { Box, Input, Button } from '@chakra-ui/react'

function Addtodo() {
    const inputRef = useRef();

    return (
        <Box>
            <Input 
                placeholder="Enter here"
                ref={inputRef}
                autoFocus={true}
            />
            <Button colorScheme="blue">Sumbit</Button>
        </Box>
    )
}

export default Input
